import React from 'react';
import ReactDOM from 'react-dom';
import Lic from './lic_page';
//import Global from '../App';

class Home extends React.Component {

  lic_page = () => {

   ReactDOM.render(<Lic />, document.getElementById('door'));
   var global = document.getElementById('global');
   global.style.background = "#67a5ad";

  }

  render() {

    return (
     <div id="home_page">
      <div id="header_info">
        <div id="lic_ruch">
           <p>233505656</p>
           <p></p>
           <p></p>
        </div>
        <div id="kil_osib">
          <p>Колличество чел.</p>
          <p>1</p>
        </div>
        <div id="type_rozrah">
          <p>Тип расчета</p>
        </div>
        <div id="service_one">
            <p>Водоподача</p>
            <p>12.09</p>
        </div>
        <div id="service_two">
            <p>Водоотвод</p>
            <p>23.09</p>
        </div>

      </div>
      <div id="block_buttons">


      </div>
         <button onClick={this.lic_page} id="lic_button">click me</button>
     </div>
    );
  }

}

export default Home;
